import { useState } from "react";
import toast from "react-hot-toast";
import axios from "../../utils/axios";
import PublicLayout from "../../components/layout/PublicLayout";

/* ------------------ S3 UPLOAD ------------------ */
const uploadToS3 = async (file, folder) => {
  const { data } = await axios.get(
    `/s3/presigned-url?fileType=${encodeURIComponent(
      file.type
    )}&folder=${encodeURIComponent(folder)}`
  );

  const res = await fetch(data.uploadUrl, {
    method: "PUT",
    body: file,
  });

  if (!res.ok) throw new Error("Upload failed");
  return data.fileUrl;
};

const ModelRegister = () => {
  const [loading, setLoading] = useState(false);

  const [form, setForm] = useState({
    /* PROFILE HEADER */
    stageName: "",
    age: "",
    tagline: "",
    city: "",
    nationality: "",

    /* BASIC */
    gender: "Female",
    email: "",
    phone: "",

    /* PHYSICAL */
    heightCm: "",
    weightKg: "",
    cupSize: "",
    bodyType: "",
    hairColor: "",
    eyeColor: "",
    ethnicity: "",

    /* SERVICES */
    services: [],
    placeOfService: [],
    profileType: "",

    /* RATES */
    rates: {},
    currency: "AED",

    /* AVAILABILITY */
    days: [],
    availabilityText: "",

    /* CONTACT */
    website: "",
    preferredContact: "",

    /* ABOUT */
    aboutMe: "",

    /* META */
    languages: "",
  });

  const [profileImages, setProfileImages] = useState([]);
  const [galleryImages, setGalleryImages] = useState([]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === "checkbox") {
      setForm((p) => {
        const arr = p[name] || [];
        return {
          ...p,
          [name]: checked ? [...arr, value] : arr.filter((v) => v !== value),
        };
      });
    } else {
      setForm((p) => ({ ...p, [name]: value }));
    }
  };

  /* ------------------ SUBMIT ------------------ */
  const submit = async (e) => {
    e.preventDefault();

    try {
      setLoading(true);

      const uploadedProfile = [];
      for (const img of profileImages) {
        uploadedProfile.push({
          url: await uploadToS3(img, "models/profile"),
          type: "image",
        });
      }

      const uploadedGallery = [];
      for (const img of galleryImages) {
        uploadedGallery.push({
          url: await uploadToS3(img, "models/portfolio"),
          type: "image",
        });
      }

      const payload = {
        stageName: form.stageName,
        gender: form.gender,
        email: form.email,
        phone: form.phone,
        city: form.city,

        heightCm: Number(form.heightCm) || undefined,
        weightKg: Number(form.weightKg) || undefined,
        bodyType: form.bodyType,
        hairColor: form.hairColor,
        eyeColor: form.eyeColor,

        skills: form.services,
        availableFor: form.placeOfService,

        languages: form.languages
          ? form.languages.split(",").map((l) => l.trim())
          : [],

        profileImage: uploadedProfile[0],
        portfolio: uploadedGallery,
      };

      await axios.post("/models/register", payload);

      toast.success("Profile submitted for review");
    } catch (err) {
      toast.error(err.response?.data?.message || "Submission failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <PublicLayout>
      <main className="single-profile">
        <section className="sp-title-bar">
          <div className="sp-inner">
            <h1 className="sp-main-title">Model Registration</h1>
            <p className="sp-subline">
              Submit your details to create a verified profile
            </p>
          </div>
        </section>

        <section className="sp-details">
          <div className="sp-inner">
            <form className="reg-form" onSubmit={submit}>
              {/* PROFILE HEADER */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Profile Header</h2>

                <input
                  name="stageName"
                  placeholder="Display name"
                  onChange={handleChange}
                  required
                />

                <input
                  name="age"
                  type="number"
                  min="18"
                  placeholder="Age"
                  onChange={handleChange}
                  required
                />

                <input
                  name="city"
                  placeholder="Dubai Marina"
                  onChange={handleChange}
                />
              </div>

              {/* SERVICES */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Services</h2>

                {["GFE", "Massage", "Couples", "OWO"].map((s) => (
                  <label key={s}>
                    <input
                      type="checkbox"
                      name="services"
                      value={s}
                      onChange={handleChange}
                    />
                    {s}
                  </label>
                ))}
              </div>

              {/* MEDIA */}
              <div className="sp-card reg-card">
                <h2 className="reg-section-title">Photos</h2>

                <input
                  type="file"
                  multiple
                  accept="image/*"
                  onChange={(e) => setProfileImages(Array.from(e.target.files))}
                />

                <input
                  type="file"
                  multiple
                  accept="image/*"
                  onChange={(e) => setGalleryImages(Array.from(e.target.files))}
                />
              </div>

              <button className="reg-submit-btn" disabled={loading}>
                {loading ? "Submitting..." : "Submit Profile"}
              </button>
            </form>
          </div>
        </section>
      </main>
    </PublicLayout>
  );
};

export default ModelRegister;
